import classes from "./CSS/Input.module.css";

const Input = (props) => {
  return (
    <div className={`${classes.input} ${props.className}`}>
      <label htmlFor={props.input.id}>{props.label} onClick={console.log('Clicked!')}</label>
      <input {...props.input} />
    </div>
  );
};

export default Input;
